// pages/About.js
import React from 'react';
import '.'

function About() {
  return (
    <div>
      <h1>About BMW</h1>
      <p>BMW, or Bayerische Motoren Werke AG, is a German multinational company that produces luxury vehicles and motorcycles.</p>
      <p>Founded in 1916, BMW has established itself as a leading brand known for its performance, innovation, and design.</p>
    </div>
  );
}

export default About;
